Example: template<typename Systems>
auto register_to_systems(Systems* systems) -> void
{ if constexpr (systems->contains<MySystemA>()) { auto system_a = systems->get<MySystemA>(); // ... } if constexpr (systems->contains<MySystemB>()) { auto system_b = systems->get<MySystemB>(); // ... }
} You won't get any compiler error if the Systems as a static system componsition doesn't contain the sepicified system or as a concrete system type that is not the specified one, as that can be infered in compile time and will be ignored thanks to if constexpr. It's up to you to decide if you want to add requires or static_assert, but it's recommended to leave it as it is. register_to_systems can be called multiple times on different systems, sometimes this way is more convenient than calling it once on a system composition that contains all the systems when if register to a particuar system depends. struct MyComponent
